Storyline:


     Following the Civil War, the state of Texas, needing money, sells land to a syndicate of northerners headed by Judd Hastings (Ray Teal). When Hastings demands the land, and the squatters refuses to vacate, the governor sends Mike McGann (Dennis Morgan) to settle the issues.




